import styled from 'styled-components';

export const Container = styled.div `
  width: 100vw;
  height: 100vh;
  display: grid;
  grid-template-columns: 15vw 85vw;
  background-color: black;

  > nav {
    grid-column-start: 1;
    grid-column-end: 2;
    height: 100vh;
    background-color: blue;
    display: flex;
    flex-direction: column;

    > Button {
      height: auto;
    }
  }

`;
